import styles from '../styles/scss/sign-in.module.scss';

const Login = () => {
	return (
		<main className={styles.loginContainer}>
			<section className={styles.logoHeader}>
				<img src="/images/logo.jpg" />
			</section>
			<section className={styles.cartoonImage}>
				<img src="/images/cartoon-social.png" alt="Youtube Workflow" />
			</section>
		</main>
	);
};

export default Login;
